import React, {Component} from 'react'

class Form extends Component {
  render() {
      return(
        <div class="box">
            <div class="form">
                <div class="title">Registration</div>
                <div class="contenuto">
                <form action="#" id="myForm">
                    <div class="bottone">
                    <input type="file" value="Carica CSV" accept=".csv" id="csvFile"/>
                    </div>
                    <div class=" elaborazione_form">
                    <input type="submit" name="" value="Elabora" class="button" />
                    </div>
                </form>
                </div>
            </div>
        </div>
      );
  }

  submitForm = () => {
      this.props.handleSubmit(this.state)
      this.setState(this.initialState)
  }

}

export default Form;
